import React, { useEffect, useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import Heart from './Heart';
import Page2 from './Page2';
import Page3 from './Page3';
import Page4 from './Page4';
import MiniMusicPlayer from './MiniMusicPlayer';

const Welcome = ({ onNext, audioRef }) => {
  const textVariants = {
    hidden: { opacity: 0, scale: 0.5, y: 50 },
    visible: { 
      opacity: 1, 
      scale: 1,
      y: 0,
      transition: { duration: 1.5, ease: "easeOut" }
    }
  };

  const handleLetGo = () => {
    if (audioRef && audioRef.current) {
      audioRef.current.play().catch(e => console.log("Play failed:", e));
    }
    onNext();
  };

  return (
    <div className="relative w-full h-screen overflow-hidden bg-gradient-to-br from-rose-300 via-pink-300 to-red-200 flex items-center justify-center">
      <motion.div
        className="absolute top-10 right-10 text-3xl sm:text-5xl"
        animate={{ y: [0, -30, 0] }}
        transition={{ duration: 3, repeat: Infinity, ease: "easeInOut" }}
      >
        ðŸ’•
      </motion.div>
      <motion.div
        className="absolute bottom-20 left-10 text-3xl sm:text-5xl"
        animate={{ y: [0, -20, 0], x: [0, 15, 0] }}
        transition={{ duration: 4, repeat: Infinity, ease: "easeInOut", delay: 1 }}
      >
        ðŸ’–
      </motion.div>
      <motion.div
        className="absolute top-1/3 right-20 text-2xl sm:text-4xl"
        animate={{ scale: [1, 1.3, 1] }}
        transition={{ duration: 2, repeat: Infinity, ease: "easeInOut" }}
      >
        ðŸ’—
      </motion.div>

      <div className="text-center px-4 z-10">
        <motion.h1
          variants={textVariants}
          initial="hidden"
          animate="visible"
          className="text-4xl sm:text-5xl md:text-6xl lg:text-7xl xl:text-8xl font-bold text-white drop-shadow-2xl mb-8"
          style={{
            fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive",
            textShadow: '4px 4px 8px rgba(0,0,0,0.3), 0 0 30px rgba(255,255,255,0.6)',
            whiteSpace: 'pre-line'
          }}
        >
          My loveeeeee
          <br />
          get readyyyyyy
        </motion.h1>

        <motion.button
          initial={{ opacity: 0, scale: 0 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ delay: 1.5, duration: 0.5 }}
          whileHover={{ scale: 1.1 }}
          whileTap={{ scale: 0.95 }}
          onClick={handleLetGo}
          className="mt-8 sm:mt-12 px-8 sm:px-12 py-3 sm:py-4 bg-white text-red-500 font-bold rounded-full shadow-2xl hover:shadow-2xl transform transition-all duration-300 text-xl sm:text-2xl md:text-3xl"
          style={{
            fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive",
          }}
        >
          Let's goooooo
        </motion.button>
      </div>
    </div>
  );
};

const GrowingFlower = ({ delay, baseX, baseY, flowerType, scale = 1 }) => {
  const stemHeight = 150 * scale;
  const petalSize = 30 * scale;
  const centerSize = 15 * scale;

  // Different flower colors based on type
  const colors = [
    { petal1: '#ff69b4', petal2: '#ff1493', center: '#ffd700' },
    { petal1: '#ff85c1', petal2: '#ff4da6', center: '#ffed4e' },
    { petal1: '#ff9fd3', petal2: '#ff66b3', center: '#fff44f' },
  ];
  const color = colors[flowerType % colors.length];

  return (
    <svg
      className="absolute pointer-events-none"
      style={{
        left: baseX,
        bottom: baseY,
        width: petalSize * 4,
        height: stemHeight + petalSize * 3,
        overflow: 'visible',
      }}
    >
      {/* Stem growing from bottom */}
      <motion.line
        x1={petalSize * 2}
        y1={stemHeight + petalSize * 2.5}
        x2={petalSize * 2}
        y2={petalSize * 2.5}
        stroke="#2d5016"
        strokeWidth={4 * scale}
        initial={{ pathLength: 0, opacity: 0 }}
        animate={{ pathLength: 1, opacity: 1 }}
        transition={{ duration: 1, delay: delay, ease: "easeOut" }}
        strokeLinecap="round"
      />

      {/* Left Leaf */}
      <motion.path
        d={`M ${petalSize * 2} ${stemHeight * 0.6 + petalSize * 2.5} Q ${petalSize * 1.3} ${stemHeight * 0.5 + petalSize * 2.5} ${petalSize * 1.5} ${stemHeight * 0.3 + petalSize * 2.5}`}
        fill="none"
        stroke="#4a7c2c"
        strokeWidth={3 * scale}
        initial={{ pathLength: 0, opacity: 0 }}
        animate={{ pathLength: 1, opacity: 1 }}
        transition={{ duration: 0.6, delay: delay + 1, ease: "easeOut" }}
        strokeLinecap="round"
      />

      {/* Right Leaf */}
      <motion.path
        d={`M ${petalSize * 2} ${stemHeight * 0.6 + petalSize * 2.5} Q ${petalSize * 2.7} ${stemHeight * 0.5 + petalSize * 2.5} ${petalSize * 2.5} ${stemHeight * 0.3 + petalSize * 2.5}`}
        fill="none"
        stroke="#4a7c2c"
        strokeWidth={3 * scale}
        initial={{ pathLength: 0, opacity: 0 }}
        animate={{ pathLength: 1, opacity: 1 }}
        transition={{ duration: 0.6, delay: delay + 1.1, ease: "easeOut" }}
        strokeLinecap="round"
      />

      {/* Petals - 5 petals in a flower pattern */}
      {/* Petal 1 (Top) */}
      <motion.ellipse
        cx={petalSize * 2}
        cy={petalSize * 1.2}
        rx={petalSize * 0.5}
        ry={petalSize * 0.9}
        fill={color.petal1}
        initial={{ opacity: 0, scale: 0 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.5, delay: delay + 1.5, ease: "backOut" }}
        style={{ transformOrigin: `${petalSize * 2}px ${petalSize * 2.5}px` }}
      />

      {/* Petal 2 (Top Right) */}
      <motion.ellipse
        cx={petalSize * 2.7}
        cy={petalSize * 1.7}
        rx={petalSize * 0.5}
        ry={petalSize * 0.9}
        fill={color.petal2}
        initial={{ opacity: 0, scale: 0 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.5, delay: delay + 1.65, ease: "backOut" }}
        transform={`rotate(72 ${petalSize * 2} ${petalSize * 2.5})`}
        style={{ transformOrigin: `${petalSize * 2}px ${petalSize * 2.5}px` }}
      />

      {/* Petal 3 (Bottom Right) */}
      <motion.ellipse
        cx={petalSize * 2.5}
        cy={petalSize * 3.2}
        rx={petalSize * 0.5}
        ry={petalSize * 0.9}
        fill={color.petal1}
        initial={{ opacity: 0, scale: 0 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.5, delay: delay + 1.8, ease: "backOut" }}
        transform={`rotate(144 ${petalSize * 2} ${petalSize * 2.5})`}
        style={{ transformOrigin: `${petalSize * 2}px ${petalSize * 2.5}px` }}
      />

      {/* Petal 4 (Bottom Left) */}
      <motion.ellipse
        cx={petalSize * 1.5}
        cy={petalSize * 3.2}
        rx={petalSize * 0.5}
        ry={petalSize * 0.9}
        fill={color.petal2}
        initial={{ opacity: 0, scale: 0 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.5, delay: delay + 1.95, ease: "backOut" }}
        transform={`rotate(216 ${petalSize * 2} ${petalSize * 2.5})`}
        style={{ transformOrigin: `${petalSize * 2}px ${petalSize * 2.5}px` }}
      />

      {/* Petal 5 (Top Left) */}
      <motion.ellipse
        cx={petalSize * 1.3}
        cy={petalSize * 1.7}
        rx={petalSize * 0.5}
        ry={petalSize * 0.9}
        fill={color.petal1}
        initial={{ opacity: 0, scale: 0 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.5, delay: delay + 2.1, ease: "backOut" }}
        transform={`rotate(288 ${petalSize * 2} ${petalSize * 2.5})`}
        style={{ transformOrigin: `${petalSize * 2}px ${petalSize * 2.5}px` }}
      />

      {/* Center Circle */}
      <motion.circle
        cx={petalSize * 2}
        cy={petalSize * 2.5}
        r={centerSize}
        fill={color.center}
        initial={{ opacity: 0, scale: 0 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.4, delay: delay + 2.3, ease: "backOut" }}
      />

      {/* Gentle sway animation after flower is complete */}
      <motion.g
        animate={{
          rotate: [-2, 2, -2],
        }}
        transition={{
          duration: 3,
          repeat: Infinity,
          ease: "easeInOut",
          delay: delay + 3,
        }}
        style={{ transformOrigin: `${petalSize * 2}px ${stemHeight + petalSize * 2.5}px` }}
      >
        {/* This group would contain all elements for sway - keeping structure simple */}
      </motion.g>
    </svg>
  );
};

const Page1 = ({ onNext }) => {
  const [hearts, setHearts] = useState([]);
  const [flowers, setFlowers] = useState([]);
  const [showMessage, setShowMessage] = useState(false);
  const [windowSize, setWindowSize] = useState({ width: 0, height: 0 });

  useEffect(() => {
    const handleResize = () => {
      setWindowSize({ width: window.innerWidth, height: window.innerHeight });
    };

    handleResize();
    window.addEventListener('resize', handleResize);

    return () => window.removeEventListener('resize', handleResize);
  }, []);

  useEffect(() => {
    const generateHearts = () => {
      const newHearts = [];

      for (let i = 0; i < 15; i++) {
        newHearts.push({
          id: `float-${i}`,
          size: Math.random() * 20 + 15,
          position: {
            x: `${Math.random() * 100}%`,
            y: `${Math.random() * 100}%`
          },
          delay: Math.random() * 5,
          duration: Math.random() * 3 + 4,
          type: 'float'
        });
      }

      for (let i = 0; i < 8; i++) {
        newHearts.push({
          id: `pulse-${i}`,
          size: Math.random() * 25 + 20,
          position: {
            x: `${Math.random() * 100}%`,
            y: `${Math.random() * 100}%`
          },
          delay: Math.random() * 3,
          duration: Math.random() * 2 + 2,
          type: 'pulse'
        });
      }

      for (let i = 0; i < 12; i++) {
        newHearts.push({
          id: `static-${i}`,
          size: Math.random() * 15 + 10,
          position: {
            x: `${Math.random() * 100}%`,
            y: `${Math.random() * 100}%`
          },
          delay: Math.random() * 2,
          duration: Math.random() * 2 + 1,
          type: 'static'
        });
      }

      setHearts(newHearts);
    };

    generateHearts();

    // Generate flowers after component mounts
    const timer = setTimeout(() => {
      if (windowSize.width === 0) return;

      const isMobile = windowSize.width < 640;
      const numFlowers = isMobile ? 5 : 7;
      const spacing = windowSize.width / (numFlowers + 1);
      const newFlowers = [];

      for (let i = 0; i < numFlowers; i++) {
        newFlowers.push({
          id: `flower-${i}`,
          baseX: spacing * (i + 1) - 60,
          baseY: 0,
          delay: i * 0.4,
          flowerType: i,
          scale: isMobile ? 0.7 : 1,
        });
      }

      setFlowers(newFlowers);

      // Show message after all flowers are complete
      setTimeout(() => setShowMessage(true), (numFlowers * 0.4) + 3500);
    }, 500);

    return () => clearTimeout(timer);
  }, [windowSize]);

  const mainText = "Wazaaaaap Medooooooooooooooo";

  return (
    <div className="relative w-full h-screen overflow-hidden bg-gradient-to-br from-pink-400 via-pink-300 to-rose-200">
      {/* Animated Hearts Background */}
      <AnimatePresence>
        {hearts.map((heart) => (
          <Heart
            key={heart.id}
            size={heart.size}
            position={heart.position}
            delay={heart.delay}
            duration={heart.duration}
            type={heart.type}
          />
        ))}
      </AnimatePresence>

      {/* Header with Main Text */}
      <div className="relative w-full pt-4 sm:pt-6 md:pt-8 text-center z-20">
        <motion.h1 
          initial={{ opacity: 0, scale: 0.5 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 1, ease: "easeOut" }}
          className="text-2xl sm:text-3xl md:text-4xl lg:text-5xl xl:text-6xl font-bold text-white drop-shadow-2xl px-4"
          style={{
            fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive",
            textShadow: '3px 3px 6px rgba(0,0,0,0.3), 0 0 20px rgba(255,255,255,0.5)',
          }}
        >
          {mainText}
        </motion.h1>
      </div>

      {/* Growing Flowers from Bottom */}
      <div className="absolute inset-0 pointer-events-none z-10">
        {flowers.map((flower) => (
          <GrowingFlower
            key={flower.id}
            delay={flower.delay}
            baseX={flower.baseX}
            baseY={flower.baseY}
            flowerType={flower.flowerType}
            scale={flower.scale}
          />
        ))}
      </div>

      {/* Message that appears after flowers grow */}
      <AnimatePresence>
        {showMessage && (
          <motion.div
            initial={{ opacity: 0, scale: 0.8, y: 50 }}
            animate={{ opacity: 1, scale: 1, y: 0 }}
            exit={{ opacity: 0 }}
            transition={{ duration: 0.8, ease: "easeOut" }}
            className="absolute top-1/4 left-1/2 -translate-x-1/2 pointer-events-none z-30"
          >
            <div className="bg-white/95 backdrop-blur-md rounded-2xl sm:rounded-3xl px-6 py-4 sm:px-10 sm:py-6 shadow-2xl mx-4">
              <p className="text-xl sm:text-2xl md:text-3xl lg:text-4xl font-bold text-pink-600 text-center whitespace-nowrap"
                style={{
                  fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive",
                  textShadow: '2px 2px 4px rgba(0,0,0,0.1)'
                }}
              >
                Just for you ðŸ’•
              </p>
            </div>
          </motion.div>
        )}
      </AnimatePresence>

      {/* Next Button - ALWAYS VISIBLE */}
      <motion.div
        initial={{ opacity: 0, scale: 0 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ delay: 4.5, duration: 0.5 }}
        className="fixed bottom-4 sm:bottom-6 md:bottom-8 left-1/2 -translate-x-1/2 z-50"
      >
        <motion.button
          onClick={onNext}
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          className="px-8 sm:px-10 md:px-12 py-3 sm:py-4 bg-gradient-to-r from-pink-500 to-rose-500 text-white font-bold rounded-full shadow-2xl hover:shadow-3xl transform transition-all duration-300 text-lg sm:text-xl md:text-2xl"
          style={{
            fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive",
          }}
        >
          Continue â†’
        </motion.button>
      </motion.div>
    </div>
  );
};

const App = () => {
  const [currentPage, setCurrentPage] = useState(0);
  const [playerAudioRef, setPlayerAudioRef] = useState(null);

  const handleNext = () => {
    setCurrentPage(currentPage + 1);
  };

  return (
    <div className="relative w-full h-screen overflow-hidden">
      <MiniMusicPlayer onAudioRef={setPlayerAudioRef} />
      <AnimatePresence mode="wait">
        {currentPage === 0 && (
          <motion.div
            key="welcome"
            initial={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            transition={{ duration: 0.6 }}
            className="absolute inset-0"
          >
            <Welcome onNext={handleNext} audioRef={playerAudioRef} />
          </motion.div>
        )}

        {currentPage === 1 && (
          <motion.div
            key="page1"
            initial={{ y: 0 }}
            exit={{ y: '-100%' }}
            transition={{ duration: 0.6, ease: 'easeInOut' }}
            className="absolute inset-0"
          >
            <Page1 onNext={handleNext} />
          </motion.div>
        )}

        {currentPage === 2 && (
          <motion.div
            key="page2"
            initial={{ y: '100%' }}
            animate={{ y: 0 }}
            transition={{ duration: 0.6, ease: 'easeInOut' }}
            className="absolute inset-0"
          >
            <Page2 onNext={handleNext} />
          </motion.div>
        )}

        {currentPage === 3 && (
          <motion.div
            key="page3"
            initial={{ y: '100%' }}
            animate={{ y: 0 }}
            transition={{ duration: 0.6, ease: 'easeInOut' }}
            className="absolute inset-0"
          >
            <Page3 onNext={handleNext} />
          </motion.div>
        )}

        {currentPage === 4 && (
          <motion.div
            key="page4"
            initial={{ y: '100%' }}
            animate={{ y: 0 }}
            transition={{ duration: 0.6, ease: 'easeInOut' }}
            className="absolute inset-0"
          >
            <Page4 />
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};

export default App;
